post_text:
Scavenger Hunt fun yesterday during parent/teacher virtual conferences!! ! As you can see, even some of our teachers made time to get in on the action in between conferences.

The hunt included: a Promise t-shirt to show school spirit; a Chromebook open to Canvas because academics are important; water bottle to stay hydrated!; something that begins with school letters C, S & N; a fruit or vegetable because we eat healthy;
a book or magazine to read for pleasure; a stuffed animal for comfy self care; a battery - keep your energy up; an unlit candle or light bulb because you are bright; mismatched socks & mismatched sneakers to show we stay active; hand soap or hand sanitizer so we keep hands clean;
and a piece of paper with #CharterFightsCOVID19 written on it!

